import React from 'react';
import Navigation from './Navigation';

const Banner = () => (
  <div className="banner">
     <Navigation />
    <img src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/49/A_black_image.jpg/640px-A_black_image.jpg" alt="Banner" />
    <img src="C:\Users\Johan\Documents\my-blog\logo2.png"/>
  </div>
);

export default Banner;
